import React from 'react'
const NavBar = () => {
    return(
        <nav id="menu">
        <h2>Menu</h2>
        <ul>
            <li><a href="index.html">Home</a></li>
            <li><a href="generic.html">Games</a></li>
            <li><a href="generic.html">Shop</a></li>
            <li><a href="generic.html">Quiz</a></li>
        </ul>
    </nav>
    )
};
export default NavBar;
